import React from "react";
import "../../styles/buttons/RouteSwitch.css";
import { Link } from "react-router-dom";

const RouteSwitch = () => {
  return (
    <div id="switch-container">
      <Link to="/">Swap</Link>
      <Link to="/claim">Claim</Link>
    </div>
  );
};

export default RouteSwitch;
